import React from "react";
import Back from "./Back";

const Notification = () => {
  return (
    <div className="bg-gray-100 min-h-screen py-8 px-4">
      <Back title="News Posts" />
      <div className="max-w-lg mx-auto bg-white rounded-lg shadow-md p-6 mt-8">
        <h2 className="text-2xl font-semibold mb-4">Notifications</h2>
        <div className="notification-container">
          <div className="notification-item flex justify-between items-center border-b border-gray-300 py-4">
            <span className="notification-text text-gray-800">
              Notification content goes here
            </span>
            <span className="notification-time text-gray-500">12:30 PM</span>
          </div>
          {/* Add more notification items as needed */}
        </div>
      </div>
    </div>
  );
};

export default Notification;
